import React from 'react';
import "./TablesListAdmin.scss";
import { map, size } from 'lodash';
import {TableAdmin} from "../"
import { Button, Icon,  Checkbox } from 'semantic-ui-react';

export function TablesListAdmin(props) {
    const {tables} = props;
  return (
    <div className='tables-list-admin'>
      <Button className='tables-list-admin__reload' primary icon onClick={() => console.log('onRefetchReload')}>
        <Icon name='refresh' />
      </Button>
      <div className='tables-list-admin__reload-toggle'>
        <span>Reload autom√°tico</span>
        <Checkbox toggle onChange={(_, data) => console.log(data.checked)}></Checkbox>
      </div>
        {map(tables, (table) =>(
            <TableAdmin key={table.number} table={table} />
        ))}
    </div>
  );
}
